function auxiliard1(spot, strike, vix, tInit,freeRate){
  // ((LN(A12/B12)+($B$6+($B$5^2/2))*($B$7/252))/($B$5*SQRT($B$7/252))) 
  // d1 = (np.log(S/K) + (r + sigma**2/2)*T)/(sigma*np.sqrt(T))
  //.  spot/strike  tasaFree, IV.    time.       IV         Time 
  var tasaFreeRisk = freeRate;
  var iv = vix * 1.034;
  var t = tInit;
  var r1 = Math.log(spot/strike);
  var r2 = (tasaFreeRisk + Math.pow(iv,2)/2) * t/365; 
  var r3 = iv * Math.sqrt(t/365);
  var r4 = (r1 + r2)/r3;
  return r4;
}

function auxiliard2(spot, strike, vix, tInit,freeRate){
  //=C12-$B$5*SQRT($B$7/252)
  //. auxd1 IV.    time 
  var d1 = auxiliard1(spot, strike, vix, tInit,freeRate);
  var r1 = vix * 1.034 * Math.sqrt(tInit/ 365) ;
  var r2 = d1 - r1;
  return r2;
}

function normalcdf(X){   //HASTINGS.  MAX ERROR = .000001
	var T=1/(1+.2316419*Math.abs(X));
	var D=.3989423*Math.exp(-X*X/2);
	var Prob=D*T*(.3193815+T*(-.3565638+T*(1.781478+T*(-1.821256+T*1.330274))));
	if (X>0) {
		Prob=1-Prob;
	}
	return Prob;
}   

/**
 * Calculates Call price with Black-Scholes model
 *
 * @param {number} spot Stock price.
 * @param {number} strike strike level.
 * @param {number} vix volatility.
 * @param {number} tInit time to exp.
 * @return The Call price.
 * @customfunction
 */
function getCall(spot,strike,vix,tInit,freeRate){
  //=A12*NORMDIST(C12,0,1,TRUE)-B12*EXP(-$B$6*($B$7/252))*NORMDIST(D12,0,1,TRUE)
  // spot         d1          strike.   tasaFree time             d2        
  var tasaFreeRisk = freeRate;
  if(tInit==0){ tInit = 0.000001}
  var d1 = auxiliard1(spot, strike, vix, tInit,freeRate);
  var d2 = auxiliard2(spot, strike, vix, tInit,freeRate);
  var a1 = spot * normalcdf(d1);
  var a2 = strike * Math.exp(-tasaFreeRisk*(tInit/365))*normalcdf(d2);
  var a3 = a1 - a2;
  return a3;

}


/**
 * Calculates Put price with Black-Scholes model
 *
 * @param {number} spot Stock price.
 * @param {number} strike strike level.
 * @param {number} vix volatility.
 * @param {number} tInit time to exp.
 * @return The put price.
 * @customfunction
 */
function getPut(spot,strike,vix,tInit,freeRate){
//B12*EXP(-$B$6*($B$7/252))*NORMDIST(-D12,0,1,TRUE)-A12*NORMDIST(-C12,0,1,TRUE)
//strike. tasaFree time               d2            spot          d1
var tasaFreeRisk = freeRate;
if(tInit==0){ tInit = 0.000001}
var d1 = auxiliard1(spot, strike, vix, tInit,freeRate);
var d2 = auxiliard2(spot, strike, vix, tInit,freeRate);
var a1 = strike * Math.exp(-tasaFreeRisk*(tInit/365)) * normalcdf(-d2);
var a2 = spot * normalcdf(-d1);
var a3 = a1 - a2;
return a3;

}

