const ll mod = (ll) (1e9+7);

ll mul(ll a , ll b , ll mod=MOD){
    return ( (a % mod) * ( b % mod)) % mod ;
}

ll BinEx(ll a , ll b , ll mod=MOD){
    ll ret =1;
    while(b){
        if( b & 1 ) ret = mul(ret , a );

        a = mul(a ,a);
        b>>=1;
    }
    return ret;
}

ll inv(ll x){
    return BinEx(x,MOD-2);
}
