public class Script : ScriptBase {
	Keys attack = Keys.F2;
	Keys reskill = Keys.F3;
	int Range = 1200;
	bool IsRunning = false;
	const int Kill_Duration = 60 * 1000;
	
	private const int Archmage = 94;
	private const int Mystic_Muse = 103;
	private const int Storm_Screamer = 110;
	private const int Soultaker = 95;
	private const int Ghost_Sentinel = 109;
	private const int Moonlight_Sentinel = 102;
	private const int Saggitarius = 92;
	private const int Trickster = 134;
	private const int Cardinal = 97;
	private const int Hierophant = 98;
	private const int Female_Soulhound = 133;
	private const int Male_Soulhound = 132;
	private const int Judicator = 136;
	private const int Doombringer = 131;
	private const int Duelist = 88;
	private const int Dreadnought = 89;
	private const int Dominator = 115;
	private const int Spectral_Dancer = 107;
	private const int Sword_Muse = 100;
	
	public class Classes{
		public int Classes_Id;
		public int Priority;
		public Classes(int classes_id, int priority){
			Classes_Id = classes_id;
			Priority = priority;}}
	
	Classes[] _Classes ={
		new Classes(Archmage, 10),
		new Classes(Mystic_Muse, 10),
		new Classes(Storm_Screamer, 10),
		new Classes(Soultaker, 10),
		new Classes(Ghost_Sentinel, 9),
		new Classes(Moonlight_Sentinel, 9),
		new Classes(Saggitarius, 9),
		new Classes(Trickster, 9),
		new Classes(Cardinal, 8),
		new Classes(Hierophant, 8),
		new Classes(Female_Soulhound, 7),
		new Classes(Male_Soulhound, 7),
		new Classes(Judicator, 7),
		new Classes(Doombringer, 6),
		new Classes(Duelist, 6),
		new Classes(Dreadnought, 6),
		new Classes(Dominator, 6),
		new Classes(Spectral_Dancer, 5),
		new Classes(Sword_Muse, 5)};
	
	public class Player_Kill{
		public string Name;
		public int OID;
		public int Time;
		public int ClassId;
		
		public Player_Kill(string name, int oid, int time, int classid){
			Name = name;
			OID = oid;
			Time = time;
			ClassId = classid;
		}
	}
	List<Player_Kill> Players_Kill = new List<Player_Kill>();
	
	public override void OnStart() {
		base.OnStart();
		EnabledChanged(true, onEnabled);
		CreateTimer(250, ClearPlayersKill);
		Revive(ResKill);
		CreateTimer(1000, showkill);
		BindKey(attack, () => !IsRunning, () =>
		        {
		        	IsRunning = true;
		        	try
		        	{
		        		Attack(false);
		        	}
		        	finally
		        	{
		        		IsRunning = false;
		        	}
		        });
		BindKey(reskill, () => !IsRunning, () =>
		        {
		        	IsRunning = true;
		        	try
		        	{
		        		ResKillAttack(false);
		        	}
		        	finally
		        	{
		        		IsRunning = false;
		        	}
		        });
	}
	
	void onEnabled(){
		Players_Kill.Clear();
	}
	
	void Attack(bool force){
			var pr = _Classes.OrderByDescending(p => p.Priority);
		foreach(var cl in pr){
			var target = Players
				.Where(p => p.DistanceToUser <= Range && !p.IsCelestialed && !p.IsMedused && !p.IsDead)
				.Where(p => !p.IsClanMate && !p.IsPartyMate)
				.Where(p => p.Class.Id == cl.Classes_Id)
				.OrderBy(p => p.DistanceToUser)
				.FirstOrDefault();
			if(target != null){
				Client.SetTarget(target);
				if (!IsDisabled() && IsCorrectTarget(Me.Target))
					Client.Attack();
				return;
			}
		}
	}
	void ResKillAttack(bool force){
	var pr = _Classes.OrderByDescending(p => p.Priority);
		foreach(var p in pr){
			var resk = Players_Kill.Where(t => t.ClassId == p.Classes_Id).FirstOrDefault();
			if(resk != null){
				Client.SetTarget(resk.OID);
				Client.Attack();
				return;
				}
			}
	}
	void ResKill(L2Live target){
		Console.WriteLine("reskill");
		int[] classesToTrackReskill = _Classes.Select(c => c.Classes_Id).ToArray();
		if(classesToTrackReskill.Contains(target.Class.Id)){
			Player_Kill player = new Player_Kill(target.Name, target.ObjectId, TimeNow(), target.Class.Id);
			Players_Kill.RemoveAll(p => p.OID == target.ObjectId);
			Players_Kill.Add(player);
			Console.WriteLine(player);
		}
	}
	void ClearPlayersKill(){
		Players_Kill.RemoveAll(p => p.Time + Kill_Duration <= TimeNow());
		Players_Kill.RemoveAll(p => Players.FindByObjectId(p.OID) == null);
	}
	void showkill(){
		Console.WriteLine("list show");
		foreach(Player_Kill pl in Players_Kill){
			Console.WriteLine(string.Format("Name: {0}, time: {1}, Class: {2}", pl.Name, pl.Time, pl.ClassId));
		}
	}
	public bool IsDisabled()
	{
		return Me.IsTranced || Me.IsDead || Me.IsMedused;
	}
	public bool IsCorrectTarget(L2Live player)
	{
		return !player.IsDead && !player.IsCelestialed && !player.IsPartyMate;
	}
	int TimeNow(){
		return Environment.TickCount;
	}
}

#include <bits/stdc++.h>

using namespace std;

#define llong long long int

const int NOANS = 1e9 + 5;

int n, k, x;
vector<int> a, b, c, d;
vector<vector<int>> memo;

int rating(int i = 0, int diff = 0) {
    if (i >= n) return x + diff;
    if (diff < -k) return rating(i + 1, diff + (c[i] ? a[i] : -b[i]));
    if (diff > k) return rating(i + 1, diff + (d[i] ? a[i] : -b[i]));

    int &ans = memo[i][diff + k];
    if (ans != NOANS) return ans;

    ans = rating(i + 1, diff + (c[i] ? a[i] : -b[i]));
    ans = max(ans, rating(i + 1, diff + (d[i] ? a[i] : -b[i])));

    return ans;
}

int main() {
    ios_base::sync_with_stdio(false);
    cin.tie(NULL);

    cin >> n >> k >> x;

    a.resize(n);
    b.resize(n);
    c.resize(n);
    d.resize(n);

    for (int i = 0; i < n; i++)
        cin >> a[i] >> b[i] >> c[i] >> d[i];

    memo.assign(n + 5, vector<int>(2 * k + 5, NOANS));

    int ans = rating();
    cout << ans << "\n";
}

