void calc_time(int seconds) {
	int hours = seconds / (60 * 60);
	int minutes = (seconds / 60) % 60;
	int sec = seconds % 60;

	cout << hours << ":"
		<< minutes << ":"
		<< sec << endl;
}

void task_time() {
	int s = 36000;
	calc_time(s); 
	int s2 = 24 * 60 * 60 - s;
	calc_time(s2);
}

